import React from 'react';
import '../styles/about.css';  
const About = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>We are passionate about creating seamless and dynamic web experiences.</p>
      
      <div className="team">
        <div className="card">
          <img src="https://via.placeholder.com/150" alt="Founder" />
          <h3>Mudit </h3>
          <p>Founder & CEO</p>
        </div>
        <div className="card">
          <img src="https://via.placeholder.com/150" alt="Developer" />
          <h3>Jane Smith</h3>
          <p>Lead Developer</p>
        </div>
      </div>
    </div>
  );
};

export default About;
